import React from 'react';
import logo from '../../logo.svg';
import { Header }  from '../Header/header';
import { Gizmos }  from '../Gizmos/gizmos';
import { ExternalApi } from '../ExternalApi/externalApi';
import { BasementBuilder } from '../BasementBuilder/basementBuilder';
import { Footer } from '../Footer/footer.js';
import './App.css';

function App() {
return (
<div className='app'>
  <div className='header--container'>
    <Header className='header' />
  </div>
  <div className='gizmos--container'>
    <Gizmos />
  </div>
  <div className='ExternalApi--container'>
    <ExternalApi />
  </div>
  <div className='BasementBuilder--container'>
    <BasementBuilder />
  </div>
  <div className='Footer--container'>
    <Footer />
  </div>
</div>
);
}

export default App;
